text:
both anthologies are available now on amazon!  grab one for the poetry lover in your life!
☀️🖤☀️🖤☀️🖤
“splintered souls” is a anthology of poems dealing with mental health written by 8 very talented poets!  through the voices of these 8 women readers will feel the soul shattering weight of struggle into, through, and climbing out of the depths of depression.  to learn more about the writers and discover their work, please check out their accounts!
@emilyapoetry 
@a_brown_writes 
@eloise_the_typewriter 
@m.g.petri
@abbeyforrestpoems 
@mrs_poems 
@unseen_unheard_poet 
@missfinnpoet 
______________________
a.b.baird publishing
*honesty*integrity*
*professionalism* 
everyone starts somewhere, let us help you!
—————————
tending broken stems is an anthology of poems with contributions from ten fabulous writers: @kevinvargo_ 
@poemsandpeonies 
@itskabes 
@poetwithhooves 
@nebulahymns
@kimmerywrites 
@jeremybrown21 
@born_maverick 
@j_a_lyon 
@my_paper_trails 
don’t miss out on your opportunity to own exclusive poems by these sure to be favorite writers! ‘tending broken stems’ is a work born out of the brilliance that follows the dark- weaving lingering doubts with reoccurring hopes. the contributing writers each bare their soul, giving readers a sense of their brokenness, their failings, their healing, and their eventual acceptance of self love found in their own journeys.  we invite you to join them. —————————
tending broken stems, available on amazon now! —————————
